import React from 'react';
import '../accueil/Accueil.css';
import 'bootstrap/dist/css/bootstrap.css';

import Icon from 'react-ionicons/lib/barcode-outline';
class Accueil extends React.Component {

    constructor(props){
        super(props);    
    }

    render(){
        return (
            
         <div id="content-wrapper" className="d-flex">
           <div id="sidebar-container" className="bg-light border-right" >
               <div className="logo">Majda</div>
               <div className="menu list-group-flush">
                   <a href="" className="list-group-item list-group-item-action bg-light p-3 border-0"> <Icon />
                   DASHBOARD</a>    
                     <a href="" className="list-group-item list-group-item-action bg-light p-3 border-0"> <Icon />
                     Taches</a> 
                     <a href="" className="list-group-item list-group-item-action bg-light p-3 border-0"> <Icon />
                     Dashbord</a> 
                     <a href="" className="list-group-item list-group-item-action bg-light p-3 border-0"> <Icon />
                     Projet</a> 
                     <a href="" className="list-group-item list-group-item-action bg-light p-3 border-0"> <Icon />
                     Projet</a> 
                     <a href="" className="list-group-item list-group-item-action bg-light p-3 border-0"> <Icon />
                     Projet</a> 
                     <a href="" className="list-group-item list-group-item-action bg-light p-3 border-0"> <Icon />
                     Projet</a>              
               </div>
           </div>
         </div>
        );
    }
}

export default Accueil;
